                values: new object[] { "<h3><img src=\"data:image/png;base64,\" width=\"577\" height=\"247\"></h3>\r\n<h3>De basis</h3>\r\n<p>Voordat je begint aan een praktijkopdracht ga je eerst een goede basis leggen. Je krijgt les in C# programmeren, databases benaderen vanuit C# en modeleren met behulp van de Unified Modelling Language (UML). Ook gebruik je Scrum om samen het project te realiseren. In een klein project, waarin je een eenvoudig spel gaat bouwen, ga je de kennis al direct toepassen.</p>\r\n<h3>De praktijk</h3>\r\n<p>In de tweede periode van het semester breng je de opgedane kennis in de praktijk door een project te doen. Je werkt daarbij samen met ongeveer vijf studenten. Je kiest met je projectgroep uit een aantal opdrachten die je vervolgens gaat uitvoeren. Tijdens het project ontwerp je de applicatie, besteed je aandacht aan projectmanagement en programmeer je de applicatie. Voorbeelden van gebouwde applicaties zijn: een applicatie waarmee een wijkagent inzicht krijgt in delicten die hebben plaats gevonden in zijn of haar wijk. Op een kaart worden de locaties van de delicten getoond, en de Twitter berichten afkomstig uit die omgeving.</p>\r\n<p>Een ander team heeft een applicatie ontwikkeld voor postbezorging. Pakketjes kunnen via de applicatie aangeboden worden en onderweg worden gevolgd. Forenzen en treinreizigers bezorgen de pakketjes.</p>\r\n<p>Voor ieder team is een opdrachtgever (Product Owner) beschikbaar, die per sprint met het team kijkt wat er gerealiseerd is, en welke wensen in de daarop volgende sprint gerealiseerd kunnen worden. Daarnaast heeft elke projectgroep een docent voor begeleiding.</p>", 60, 0, 50, "Object Oriented Software Design and Development", true, 2, 3 });

