                values: new object[] { "<p><img src=\"data:image/png;base64,\" width=\"719\" height=\"309\"></p>\r\n<blockquote class=\"blockquote\">\r\n<p>Webtechnologie is niet meer weg te denken uit de huidige maatschappij. Voor een informaticus is kennis hiervan onmisbaar!</p>\r\n</blockquote>\r\n<p class=\"MsoNormal\"><strong>Beschrijving</strong></p>\r\n<p class=\"MsoNormal\"><strong>Periode 1</strong><br>In deze periode besteden we aandacht aan verschillende aspecten van webtechnologie. Het doel van het semester is om te leren hoe je robuuste webapplicaties ontwerpt en realiseert.&nbsp;<span lang=\"EN-US\">Het semester bestaat uit de modules Server Technology, Client Technology en Security for web applications.</span></p>\r\n<p class=\"MsoNormal\"><strong>Client Technology</strong><br>In deze module leer je moderne client-side technieken en standaarden voor het ontwikkelen van webapplicaties. De volgende onderwerpen komen onder andere aan bod:</p>\r\n<ul>\r\n<li>HTML &amp; CSS</li>\r\n<li>Javascript</li>\r\n<li>Webcomponents</li>\r\n<li>AJAX</li>\r\n<li>Architectuur</li>\r\n</ul>\r\n<p class=\"MsoNormal\">Deze onderwerpen pas je toe in een concrete applicatie.</p>\r\n<p class=\"MsoNormal\"><strong>Server Technology</strong><br>Server Technology richt zich op het realiseren van de server-side van een webapplicatie: hetgeen dat op de (web)server draait. Dit wordt ook wel back-end genoemd. Back-end development is een ontzettend breed begrip met veel overlap en samenhang met front-end development (en natuurlijk de beveiliging). Tijdens deze module komen dan ook veel onderwerpen aan bod. Kort gezegd ga je leren wat er onder de motorkap van een webapplicatie gebeurt (of kan gebeuren), welke (on)mogelijkheden er zijn en hoe je daar geschikte keuzes in maakt.</p>\r\n<p class=\"MsoNormal\">Je leert hoe je de concepten en technieken die aan bod komen in de praktijk brengt door aan de slag te gaan met een framework. Tijdens de lessen maken we, om houvast te bieden, gebruik van het framework ASP.NET Core. Het is aan te raden om Visual Studio te gebruiken tijdens de lessen. De intentie is niet om op te leiden tot het leren van een framework. Daarom komen er concepten en technieken aan bod die in de meeste andere frameworks (denk bijvoorbeeld aan Laravel) ook relevant zijn. Zo heb je na dit semester een solide basis gelegd, waardoor je andere frameworks ook snel eigen kunt maken.</p>\r\n<p class=\"MsoNormal\"><strong>Security for web applications</strong><br>Doordat webapplicaties, per definitie, worden blootgesteld aan publieke netwerken, is beveiliging van groot belang. Het doel van het vak security is om bij het analyseren, evalueren, ontwikkelen en testen van webapplicatiesoftware de beveiligingsaspecten direct mee te nemen, om zo te voorkomen dat ze achteraf, slecht, in de applicatie worden gefrommeld.</p>\r\n<p class=\"MsoNormal\">De volgende onderwerpen komen aan de orde:</p>\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\">Information System Security &amp; OWASP: Door gebruik te maken van de Application Security Verification Standard, een lijst van maatregelen van de Open Web Application Security Project, wordt het beveiligen van software praktisch toepasbaar.</li>\r\n<li class=\"MsoNormal\">Secure Communication: Communicatie tussen client (browser) en server moet veilig (integer, vertrouwelijk) gebeuren, door gebruik te maken van cryptografie en certificaten.&nbsp;</li>\r\n<li class=\"MsoNormal\">Access Control: Wie heeft toegang tot de applicatie, hoe controleer je dat, wat mag hij/zij dan uitvoeren en hoe kan je dat auditen.&nbsp;</li>\r\n<li class=\"MsoNormal\">Server security: Welke maatregelen zijn nodig aan de server kant, met name om (SQL) injectie te voorkomen.&nbsp;</li>\r\n<li class=\"MsoNormal\">Client security: Welke maatregelen moeten voor de browser worden genomen om Cross Site Scripting te voorkomen en zo sessie hijacking tegen te gaan.<br>&nbsp;</li>\r\n<li class=\"MsoNormal\">Vulnerability scanning: Over tooling waarmee het testen op zwakheden in de software (geautomatiseerd) kan worden gedaan.</li>\r\n</ul>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Het vak wordt gegeven in 6 hoorcolleges en een werkcollege. Toetsing vindt plaats door een serie opgaven te maken: hacken (beveiligen) moet je doen om het te leren: overtuig de examinator dat je beveiliging in je vingers hebt.</p>\r\n<p class=\"MsoNormal\"><strong>Trendwatch</strong><br>Trendwatch zijn gastcolleges, workshops of andere events die te maken hebben met de nieuwste technologie. De Trendwatch zijn verdiepingen op de vakken Client Technology, Server Technology of Security. Hiervoor worden externe sprekers uitgenodigd iets te vertellen over hun vakgebied.</p>\r\n<p class=\"MsoNormal\"><strong>Periode 2</strong><br>In de tweede periode doe je samen met twee of drie medestudenten een praktijkopdracht bij een bedrijf. De module die hierbij hoort heet Project Web Development. De opdracht moet aansluiten bij &eacute;&eacute;n of meer van de vakken uit periode 1. Ofwel, het kan van alles zijn dat met web te maken heeft:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span lang=\"EN-US\">JSP, ASP.NET, PHP, ..</span></li>\r\n<li><span lang=\"EN-US\">JavaScript, HTML, CSS, ..</span></li>\r\n<li><span lang=\"EN-US\">Web Frameworks</span></li>\r\n<li><span lang=\"EN-US\">Security</span></li>\r\n<li><span lang=\"EN-US\">Mobile web</span></li>\r\n<li><span lang=\"EN-US\">..</span></li>\r\n<li>Geen apps (daarvoor is het keuzesemester &ldquo;Mobile Solutions&rdquo;)</li>\r\n</ul>\r\n<p class=\"MsoNormal\"><strong>Opbouw</strong></p>\r\n<p>In de eerste periode volg je de vakken Client, Server en Security. Tijdens deze periode werk je aan een eigen project waarin je een veilige web ontwerpt en realiseert: de showcase. In de tweede periode ga je in een klein groepje stage lopen bij een bedrijf.</p>", 60, 0, 50, "Web Development", true, 2, 3 });

