raat. Denk hierbij onder andere aan; automatisch testen, release-, requirement-, version-, en projectbeheer. De tweede periode is gereserveerd voor de benodigde sprints om de nieuwe techniek of het nieuwe component onder de knie te krijgen, het bedrijfsproduct te ontwerpen, te realiseren, te testen en in productie te brengen.</p>", 60, 0, 105, "Quality in Software Development ", true, 2, 1 });

